import React from 'react';
// import CollectionCard from './CollectionCard';
const AvgList = (avgSetList) => {
  return (
    <div className='avgList'>
        {avgSetList.map(avg=>(
            <div>
                <CollectionCard 
                key={avg.token_id}
                id={avg}
                />
            </div>
        ))}
    </div>
  )
};

export default AvgList();
